import React from 'react';

const Navbar: React.FC = () => (
  <nav
    style={{
      display: 'flex',
      alignItems: 'center',
      justifyContent: 'space-between',
      background: '#23262f',
      padding: '1.5rem 3rem',
      fontFamily: 'Montserrat, Arial, sans-serif',
    }}
  >
    {/* Logo and Title */}
    <div style={{ display: 'flex', alignItems: 'center' }}>
      {/* Replace with your SVG/logo as needed */}

      <span style={{ color: '#fff', fontWeight: 700, fontSize: '2rem', marginLeft: '0.5rem', letterSpacing: 2 }}>
        FASHION
      </span>
    </div>

    {/* Navigation Links */}
    <div style={{ display: 'flex', alignItems: 'center', gap: '2.5rem' }}>
      <a href="#" style={{ color: '#fff', textDecoration: 'none', fontWeight: 500, fontSize: '1.1rem', letterSpacing: 1 }}>CATALOGUE</a>
      <a href="#" style={{ color: '#fff', textDecoration: 'none', fontWeight: 500, fontSize: '1.1rem', letterSpacing: 1 }}>FASHION</a>
      <a href="#" style={{ color: '#fff', textDecoration: 'none', fontWeight: 500, fontSize: '1.1rem', letterSpacing: 1 }}>FAVOURITE</a>
      <a href="#" style={{ color: '#fff', textDecoration: 'none', fontWeight: 500, fontSize: '1.1rem', letterSpacing: 1 }}>LIFESTYLE</a>
      {/* Moon Icon */}
      <span style={{ fontSize: '1.5rem', marginLeft: '1.5rem', marginRight: '1.5rem' }}>ðŸŒ™</span>
      {/* Sign Up Button */}
      <button
        style={{
          background: '#000',
          color: '#fff',
          border: 'none',
          borderRadius: '8px',
          padding: '0.7rem 2rem',
          fontWeight: 600,
          fontSize: '1.1rem',
          cursor: 'pointer',
          letterSpacing: 1,
        }}
      >
        SIGN UP
      </button>
    </div>
  </nav>
);

export default Navbar;
